--
-- Table structure for table `wechat_pay_trade_flow`
--

DROP TABLE IF EXISTS `wechat_pay_trade_flow`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `wechat_pay_trade_flow` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `mch_billno` varchar(28) NOT NULL COMMENT '商户订单号（每个订单号必须唯一）\n组成：mch_id+yyyymmdd+10位一天内不能重复的数字。\n接口根据商户订单号支持重入，如出现超时可再调用。',
  `mch_id` varchar(32) NOT NULL COMMENT '微信支付分配的商户号',
  `wxappid` varchar(32) NOT NULL COMMENT '微信分配的公众账号ID（企业号corpid即为此appId）。接口传入的所有appid应该为公众号的appid（在mp.weixin.qq.com申请的），不能为APP的appid（在open.weixin.qq.com申请的）。',
  `send_name` varchar(32) NOT NULL COMMENT '商户名称\n红包发送者名称',
  `re_openid` varchar(32) NOT NULL COMMENT '接受红包的用户\n用户在wxappid下的openid',
  `total_amount` int(11) NOT NULL COMMENT '付款金额，单位分',
  `total_num` int(11) NOT NULL COMMENT '红包发放总人数',
  `wishing` varchar(128) NOT NULL COMMENT '祝福语',
  `client_ip` varchar(15) NOT NULL COMMENT '调用接口的机器Ip地址',
  `act_name` varchar(32) NOT NULL COMMENT '活动名称\n',
  `remark` varchar(256) NOT NULL COMMENT '备注信息',
  `return_code` varchar(16) NOT NULL COMMENT '通信标识，非交易标识，交易是否成功需要查看result_code来判断\nSUCCESS/FAIL',
  `return_msg` varchar(128) DEFAULT NULL COMMENT '响应消息',
  `sign` varchar(32) NOT NULL COMMENT '签名信息',
  `result_code` varchar(16) NOT NULL COMMENT 'SUCCESS/FAIL\n业务响应代码',
  `err_code` varchar(32) DEFAULT NULL COMMENT '业务错误代码',
  `err_code_des` varchar(128) DEFAULT NULL COMMENT '错误描述',
  `send_listid` varchar(32) NOT NULL COMMENT '红包订单的微信单号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

